import '../App.css';

function Rice() {
  return (
    <section style={{ backgroundColor: 'rgb(226, 229, 222)' }}>
        <div className='text'>
            <h2>Rice</h2>
            <p>Help me harvest my rice</p>
            <div className='PlayArea'></div>
        </div>
    </section>
  );
}

export default Rice;
